import './ExpenseDate.css';

const ExpenseDate = (props) => {
    const month = props.germanDate.toLocaleString("de-DE", { month: 'long' });
    const day = props.germanDate.toLocaleString("de-DE", { day: '2-digit' });
    const year = props.germanDate.getFullYear();

    return (
        <div className=''>
            <div className=''>{month}</div>
            <div className=''>{year}</div>
            <div className=''>{day}</div>
        </div>
    );
}

export default ExpenseDate;
